uật. Bạn không thể hủy kích hoạt chúng.</li><li>Session Cookie: PHP sử dụng Cookie để xác định phiên của người dùng. Nếu không có Cookie này, trang web sẽ không hoạt động.</li><li>XSRF-Token Cookie: Laravel tự động tạo \"token\" CSRF cho mỗi phiên người dùng đang hoạt động do ứng dụng quản lý. Token này được sử dụng để xác minh rằng người dùng đã xác thực là người thực sự đưa ra yêu cầu đối với ứng dụng.</li></ul>'),('vi',15,'FAQs',NULL,'<div>[faq title=\"Các câu hỏi thường gặp\"][/faq]</div>'),('vi',16,'Dịch vụ',NULL,NULL),('vi',17,'Điều khoản',NULL,NULL),('vi',18,'Sắp có',NULL,'<div>[coming-soon title=\"Chúng tôi sắp ra mắt..!!\" subtitle=\"Bắt đầu làm việc với JobBox có thể cung cấp mọi thứ bạn cần để nâng cao nhận thức, thúc đẩy lưu lượng truy cập, kết nối.\" date=\"2023-07-14\" time=\"00:00\" image=\"general/animat-rocket-color.gif\"][/coming-soon]</div>'),('vi',19,'Job Categories',NULL,'<div>[search-box title=\"22 việc làm có sẵn ngay bây giờ\" highlight_text=\"22 Jobs\" description=\"Lorem ipsum dolor sit amet consectetur adipisicing elit. Vero repellendus magni, atque delectus molestias quis?\" banner_image_1=\"pages/left-job-head.png\" banner_image_2=\"pages/right-job-head.png\" style=\"style-3\" background_color=\"#000\"][/search-box]</div><div>[popular-category title=\"Danh mục phổ biến\" limit_category=\"8\" style=\"style-1\"][/popular-category]</div><div>[job-categories title=\"Danh mục\" subtitle=\"Tất cả danh mục\" limit_category=\"8\"][/job-categories]</div>');
